const _hoisted_6 = /* @__PURE__ */ createStaticVNode('<h2 id="info" tabindex="-1"><a class="header-anchor" href="#info" aria-hidden="true">#</a> Info</h2><p><strong>Bio-Data</strong></p><ul><li>Class: Lancer</li><li>True Name: Parvati</li><li>Gender: Female</li><li>Source: India mythology</li><li>Region: India</li><li>Alignment: Lawful Good</li><li>Height: 156 cm</li><li>Weight: 46 kg</li></ul><p><strong>Meta</strong></p><ul><li>Character Creator: Nasu Kinoko</li><li>Character Illustrator: Aotsuki Takao</li><li>Character Voice: Shitaya Noriko</li><li>Appearance in Main Works: Fate/Grand Order</li></ul><h2 id="stats" tabindex="-1"><a class="header-anchor" href="#stats" aria-hidden="true">#</a> Stats</h2><table><thead><tr><th style="text-align:left;">Parameters</th><th style="text-align:center;">Values</th></tr></thead><tbody><tr><td style="text-align:left;">Strength</td><td style="text-align:center;">D</td></tr><tr><td style="text-align:left;">Constitution</td><td style="text-align:center;">C</td></tr><tr><td style="text-align:left;">Agility</td><td style="text-align:center;">D</td></tr><tr><td style="text-align:left;">Magical Power</td><td style="text-align:center;">B</td></tr><tr><td style="text-align:left;">Luck</td><td style="text-align:center;">B</td></tr><tr><td style="text-align:left;">Noble Phantasm</td><td style="text-align:center;">EX</td></tr></tbody></table><h2 id="class-skills" tabindex="-1"><a class="header-anchor" href="#class-skills" aria-hidden="true">#</a> Class Skills</h2><p><strong>Magic Resistance: A</strong></p><p>Cancels all A rank magic and below. As a matter of fact, modern magi are incapable of hurting Parvati.</p><p><strong>Goddess&#39; Divine Core: B</strong></p><p>A Skill representing one&#39;s status as a goddess perfected since birth.</p><p>Has the effect of preserving the absoluteness of mind and body. Repels most mental interference, halts body growth, and no matter how much calorie she consumed, her figure does not change.</p><p>Due to her being a pseudo-Servant, the rank stopped at B.</p><p>But who cares about that anyway.</p><p>Her figure! Does not! Change!</p><h2 id="personal-skills" tabindex="-1"><a class="header-anchor" href="#personal-skills" aria-hidden="true">#</a> Personal Skills</h2><p><strong>Imaginary Around: EX</strong></p><p>The magic trait of the vessel girl, developed even more.[1]</p><p><strong>Ashes of Kama: EX</strong></p><p>Parvati is a calm goddess, weak at fighting.</p><p>However, it does not mean that her heart too, is weak.</p><p>Her heart that think of the one she loves is stronger and its depth deeper than any manner of god.</p><p>If it is for the sake of those she loves, even if she should break her body or burn away her divinity, she will muster the strength to fight.</p><p>Even if it is only a blaze for a brief moment, she is comparable to the goddess of destruction Kali, one of Shiva&#39;s wife.</p><p>Worthy of mention is the fact that it has nothing to do with how what Shiva feels towards her.</p><p>Parvati holds the special characteristic of being able to foster her love towards someone, even if said person seems to ignore her.</p><p>It is a wholehearted love but, it&#39;s a bit... no, legendary level of heavy.</p><p>Moreover, Kama holds the meaning of love, but it also is the name of the god of love that Shiva burned to death. During his ascetic practice, Shiva had been ceaselessly ignoring Parvati, who had been sent to become Shiva\u2019s wive.</p><p>The exasperated gods then had sent Kama, disturbing Shiva\u2019s meditation using Kama\u2019s arrow, so that he would notice Parvati.[1]</p><p><strong>Blessing of the Goddess: A+</strong></p><p>A gift from the (good) goddess.</p><p>It comes from the episode when she hit her own head and gave her blood to her servant who was unable to bear thirst and starvation.[1][2]</p><p>Tl notes:</p><p>[1] ok but what does it exactly do tho</p><p>[2]literally notice me senpai</p><p>i said it b4 but parvati and sakura super fits with each other</p><p>doesnt even have to twist the legend to make them similar to each other</p><h2 id="noble-phantasm-s" tabindex="-1"><a class="header-anchor" href="#noble-phantasm-s" aria-hidden="true">#</a> Noble Phantasm(s)</h2><h1 id="trishula-shakti-to-not-see-love-is-to-be-without-love" tabindex="-1"><a class="header-anchor" href="#trishula-shakti-to-not-see-love-is-to-be-without-love" aria-hidden="true">#</a> Trishula Shakti: To Not See Love is to Be Without Love</h1><ul><li>Rank: EX</li><li>Type: Anti-Army Noble Phantasm</li><li>Range: 5~10</li><li>Maximum target: 30 individual</li></ul><p>Trishula Shakti.</p><p>The limit release of the trisula, the three-pronged spear that Parvati borrowed from Shiva.</p><p>By means of the weapon that Shiva had bestowed unto her, Parvati\u2019s class was determined.</p><p>Due to the trisula, Parvati acquired the qualifications as a Lancer.</p><p>Naturally, it is not possible to demonstrate the true value of this weapon as much as Shiva; instead, it provides assistance in protecting her framework as a Servant.[1]</p><p>Tl notes:</p><p>[1] OK BUT WHAT DOES IT EXACLTY DO - SHIVADAMMIT</p><h1 id="character" tabindex="-1"><a class="header-anchor" href="#character" aria-hidden="true">#</a> Character</h1><h2 id="pronouns" tabindex="-1"><a class="header-anchor" href="#pronouns" aria-hidden="true">#</a> Pronouns</h2><ul><li>First pronoun: watashi</li><li>Second pronoun: anata</li><li>Third pronoun: kare/kanojo/anokata</li></ul><h2 id="personality" tabindex="-1"><a class="header-anchor" href="#personality" aria-hidden="true">#</a> Personality</h2><p>The disposition of the girl who became her vessel; she is the goddess who received the light portion of said disposition.</p><p>A calm and broad minded personality. A virtuous, talented woman who does not self-assert herself and supports the Master from the side modestly.</p><p>....That being said, even if her ideal heroine power and specs are high, due to preferring the steady and subdued way over gaudiness, she is somewhat dull</p><p>She may have a gentle character, but she is by no means timid; her core is that of a strong one.</p><p>She will not break no matter what kind of torture she receives. To put it another way, she is a mass of willpower and spirit.</p><p>Hence, she is really scary when you anger her.</p><p>This Parvati shall never forget any resentment until she is satisfied..</p><p>Parvati is a quiet divine spirit; due to that, in contrast with Ishtar she manifest by means of the vessel\u2019s personality.</p><p>If in Ishtar\u2019s case, Ishtar is the \u201Ccore\u201D while the vessel girl is the \u201Cside\u201D, then it seems that in Parvati\u2019s case, the vessel girl is the \u201Ccore\u201D while Parvati is the \u201Cside\u201D.</p><p>She herself precisely understands that she is \u201Ca human who participates in the war with the power of the goddess Parvati purely as an emergency measure.\u201D</p><h2 id="attitude-towards-master" tabindex="-1"><a class="header-anchor" href="#attitude-towards-master" aria-hidden="true">#</a> Attitude Towards Master</h2><p>In a mild manner, she never forgot to not overstep the Master. [1]</p><p>As a goddess with a duty, she drew a precise line as she accompany the Master.</p><p>However, should her bond level increase, as the senpai who protects the Human Order, as the goddess who watches over the future of the brave one, she may gallantly give the Master her assistant.</p><p>Tl notes:</p><p>[1]This is based on the proverb of \u4E09\u6B69\u3055\u304C\u3063\u3066\u5E2B\u306E\u5F71\u3092\u8E0F\u307E\u305A , liberally meaning [a student must never forget to honor their teacher]. I change the wording a bit to give a better impression.</p><h2 id="dialogue-examples" tabindex="-1"><a class="header-anchor" href="#dialogue-examples" aria-hidden="true">#</a> Dialogue Examples</h2><p>\u201CGood day, Master of Chaldea. I am known as the Goddess Parvati.</p><p>In this occasion, I manifest by borrowing the body of this young maiden.</p><p>Indeed, I am that which is known as a pseudo-Servant.</p><p>This is a situation which I myself am not familiar either; why don\u2019t we learn of it together, then?\u201D</p><p>\u201CDoes this suit me? This time, I aim for an appearance where my hem will not get disarrayed, even during battle. Truthfully, I would have preferred a pink garment, but it wouldn\u2019t suit me as I am now\u2026.\u201D</p><p>\u201CThat goddess from the Middle East\u2026. Ishtar, yes? She\u2019s so lovely. I\u2019m very interested, karmically. However, isn\u2019t she just a bit too gaudy\u2026..? Sometimes too much freedom brings problem still. Ufufu\u2026.\u201D</p><h2 id="historical-character-and-figure" tabindex="-1"><a class="header-anchor" href="#historical-character-and-figure" aria-hidden="true">#</a> Historical Character and Figure</h2><p>In Indian mythology, Parvati is the wife of the god of destruction and creation, Shiva.</p><p>Parvati herself has no influence as a god, mostly treated only purely as Shiva&#39;s wife.</p><p>However, there are times where Shiva&#39;s wife has been spoken of as goddess of war. Durga and Kali.</p><p>These goddesses and Parvati are of different spiritual foundation, yet their divine core is considered to be the same.</p><p>It is possible for her to manifest as a Rider, but on that situation she would be borrowing Nandi, the divine ox belonging to Shiva. Due to normally governing over crop and harvests, it boasts low offensive power unbefitting of a divine beast.</p><h2 id="character-in-fgo" tabindex="-1"><a class="header-anchor" href="#character-in-fgo" aria-hidden="true">#</a> Character in FGO</h2><p>A pseudo-Servant who was composed with nothing but the innate goodness of the &quot;vessel girl&quot;.</p><p>Deeply related with the Holy Grail War, as well as resembling Parvati in terms of mentality; such were the reasons that this girl had been chosen.</p><p>Fundamentally speaking, other than outward appearance she is for the most part Parvati; but in the matters of Skills as well as a part of her mentality and action, the influence of the vessel girl is displayed quite strongly.</p><p>Put to words, this here is the heroine of light.</p><p>However, even if she is of light, it does not mean that she has no evil nature.</p><p>Just as there is murkiness in justice, the &quot;vessel girl&quot; have a yandere kind of feeling... There&#39;s this one leftover part that becomes truly dangerous if you make a mistake in handling her. That being said, she will just get angry a little bit, and will definitely not fall to the dark side. Even when she is distressed, she will not go out of order; it is precisely due to that that she is of a &quot;light attribute.&quot;</p><p>Since Parvati herself is a divine being that has &quot;no fault within herself&quot;, the introverted and shy parts are gone, and her sociability arises in place. She may get angry and sulk over little things, but she is the kind of beauty who would consider everything, whether or not there is a misunderstanding or a discrepancy on the subject, and either forgive the other side or apologize herself. Basically the ideal, beautiful, cute wife.</p><h2 id="standard-weapons" tabindex="-1"><a class="header-anchor" href="#standard-weapons" aria-hidden="true">#</a> Standard Weapons</h2><p>She made use as a weapon the three-pronged spear known as the trishula.</p><p>So that the design fits her preference, Parvati remodelled it into a tuning fork.</p><h2 id="related-characters" tabindex="-1"><a class="header-anchor" href="#related-characters" aria-hidden="true">#</a> Related Characters</h2><p><strong>Ishtar</strong></p><p>Their vessels are mutually and deeply tied with each other.</p><p>Because Parvati herself is not really related to Ishtar, she felt that that arrogant nature of her is one that must be propounded, yet she also feels envy towards such a freedom.</p><p>\u201CI can feel the karma\u2026. I can feel the destiny\u2026 Perhaps I should describe it as so close, yet so far\u2026 beloved, yet hated\u2026.\u201D</p><p><strong>Indian Servants</strong></p><p>Each and everyone is a cute child.</p><p><strong>Sengo Muramasa</strong></p><p>\u2026.He\u2019s quite similar to someone I know\u2026. No, actually, I do not know even of this \u201Csomeone I know\u201D... However, I feel calm simply by looking at him. Might he perhaps the honored ancestor?[1]</p><p><strong>Kama</strong></p><p>Hmm? There\u2019s such a Servant?</p><p>It\u2019s just\u2026. It\u2019s as if I am unable to see him\u2026.</p><p><strong>Medusa</strong></p><p>She\u2019s such a nice person! Beautiful, gentle, with a great figure as well! Supposing I am able to grow, I too wish to become just like her!</p><p><strong>Arjuna</strong></p><p>O Arjuna. You should not randomly unleash the Pashupata all pop-pop like that\u2026 carelessly doing that would boom so many things, you know? Boom. Well, you do have your act together, so I feel that all is fine, but still...</p><p>Tl notes:</p><p>[1]WAIT WHAT. WHAT. It uses \u5148\u7956\u69D8 btw</p><h2 id="comment-from-the-illustrator" tabindex="-1"><a class="header-anchor" href="#comment-from-the-illustrator" aria-hidden="true">#</a> Comment from the Illustrator</h2><p>I have nothing but gratitude towards those who makes use of her. Thank you very much. (Aotsuki Takao)[1]</p><p>[1] Poor Takao. Also, damn, look at all those patterns</p><h2 id="material-images" tabindex="-1"><a class="header-anchor" href="#material-images" aria-hidden="true">#</a> Material Images</h2><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-338.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-339.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-340.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-341.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-342.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-343.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-344.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-345.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-346.jpg?raw=true" alt=""></p><p><img src="https://github.com/Assets-I/Materials/blob/main/fgo-material-V/i-347.jpg?raw=true" alt=""></p><h2 id="dialogue" tabindex="-1"><a class="header-anchor" href="#dialogue" aria-hidden="true">#</a> Dialogue</h2><table><thead><tr><th style="text-align:left;">Occassion</th><th style="text-align:center;">English</th><th style="text-align:center;">Japanese</th></tr></thead><tbody><tr><td style="text-align:left;">Summoned</td><td style="text-align:center;"></td><td style="text-align:center;"></td></tr></tbody></table>', 126);
